      "turismdescription" : "?Zuhaitz-etxeak\" o Cabañas en los Árboles ofrece a los amantes de la naturaleza la oportunidad  de estar en contacto directo con la naturaleza y  dormir en un entorno íntimo y diferente.<br/><br/>El caserío Sabizar situado en el municipio de Zeanuri y muy cerca del parque natural de Gorbea,  dispone  en su entorno de cuatro cabañas en los árboles y  ofrece también otra original alternativa de alojamiento,  como son los  carros cíngaros, antiguo  medio de transporte del pueblo gitano de Hungría. <br/><br/>Las Cabañas en los Árboles, son casas aéreas de 30 m2 sujetas a los árboles del bosque con capacidad para 2 o 4 personas. Todas ellas disponen de terraza y cuentan con iluminación, agua, lavamanos y estufa. El desayuno está incluido en el servicio y se puede degustar en la misma cabaña o su terraza.<br/><br/>Los carros cíngaros para 2 y 4 personas, están situados en el jardín del caserío y están equipados con electricidad. El lavabo y las duchas están en un edificio anexo. El desayuno está incluido en el servicio.",
